import java.util.Scanner;

public class demo1 {

    public static void main(String[] args) {

        String str1 = "ACACTGACTACTGACTGGTGACTACTGACTGGCG";
        String str2 = "TATTATACGCTATTATACGCGACGCGGACGCGGC";

        //String str1="";
        //String str2="";

        //String str1="ACG";
        //String str2="GCT";

        //String str1="";
        //String str2="";


        int l1 = str1.length();
        int l2 = str2.length();
        System.out.println(l1 + "    " + l2);
        int[][] dp = new int[l1+1][l2+1];
        int gapPenality = 30;
        int misMatchPenality = 0;
        int A = 0, C = 1, G = 2, T = 3;

        int[][] misMatchCost = {{0, 110, 48, 94}, {110, 0, 118, 48}, {48, 118, 0, 110}, {94, 48, 110, 0}};

        dp[0][0] = 0;
        for (int i=1;i<=l1;i++) dp[i][0]=dp[i-1][0]+gapPenality;
        for (int j=1;j<=l2;j++) dp[0][j]=dp[0][j-1]+gapPenality;
        for (int i = 1; i <= l1; i++) {
            for (int j = 1; j <= l2; j++) {

                if (str1.charAt(i - 1) == str2.charAt(j - 1)) misMatchPenality = 0;
                else {
                    if ((str1.charAt(i - 1) == 'A' || str2.charAt(j - 1) == 'A') && (str1.charAt(i - 1) == 'C' || str2.charAt(j - 1) == 'C'))
                        misMatchPenality = misMatchCost[A][C];
                    else if ((str1.charAt(i - 1) == 'A' || str2.charAt(j - 1) == 'A') && (str1.charAt(i - 1) == 'G' || str2.charAt(j - 1) == 'G'))
                        misMatchPenality = misMatchCost[A][G];
                    else if ((str1.charAt(i - 1) == 'A' || str2.charAt(j - 1) == 'A') && (str1.charAt(i - 1) == 'T' || str2.charAt(j - 1) == 'T'))
                        misMatchPenality = misMatchCost[A][T];
                    else if ((str1.charAt(i - 1) == 'C' || str2.charAt(j - 1) == 'C') && (str1.charAt(i - 1) == 'G' || str2.charAt(j - 1) == 'G'))
                        misMatchPenality = misMatchCost[C][G];
                    else if ((str1.charAt(i - 1) == 'C' || str2.charAt(j - 1) == 'C') && (str1.charAt(i - 1) == 'T' || str2.charAt(j - 1) == 'T'))
                        misMatchPenality = misMatchCost[C][T];
                    else if ((str1.charAt(i - 1) == 'G' || str2.charAt(j - 1) == 'G') && (str1.charAt(i - 1) == 'T' || str2.charAt(j - 1) == 'T'))
                        misMatchPenality = misMatchCost[G][T];
                }

                dp[i][j] = Math.min( dp[i-1][j-1]+misMatchPenality, Math.min(dp[i-1][j], dp[i][j-1])+gapPenality );
                //System.out.println("i :  "+i+"    j :    "+j);
            }
        }

        /*System.out.println(str1);
        System.out.println(str2);
        for (int i = 0; i <= l1; i++) {
            for (int j = 0; j <= l2; j++)
                System.out.print(dp[i][j] + "  ");
            System.out.println();
        }*/

        int len=l1+l2;
        int i=l1;   //current index of str1
        int j=l2;   //current index of str2

        int s1i=len-1;
        int s2i=len-1;

        char s1res[] = new char[len];
        char s2res[] = new char[len];

        while (i!= 0 && j!=0){
            if (str1.charAt(i-1)==str2.charAt(j-1)) misMatchPenality=0;
            else {
                if ((str1.charAt(i - 1) == 'A' || str2.charAt(j - 1) == 'A') && (str1.charAt(i - 1) == 'C' || str2.charAt(j - 1) == 'C'))
                    misMatchPenality = misMatchCost[A][C];
                else if ((str1.charAt(i - 1) == 'A' || str2.charAt(j - 1) == 'A') && (str1.charAt(i - 1) == 'G' || str2.charAt(j - 1) == 'G'))
                    misMatchPenality = misMatchCost[A][G];
                else if ((str1.charAt(i - 1) == 'A' || str2.charAt(j - 1) == 'A') && (str1.charAt(i - 1) == 'T' || str2.charAt(j - 1) == 'T'))
                    misMatchPenality = misMatchCost[A][T];
                else if ((str1.charAt(i - 1) == 'C' || str2.charAt(j - 1) == 'C') && (str1.charAt(i - 1) == 'G' || str2.charAt(j - 1) == 'G'))
                    misMatchPenality = misMatchCost[C][G];
                else if ((str1.charAt(i - 1) == 'C' || str2.charAt(j - 1) == 'C') && (str1.charAt(i - 1) == 'T' || str2.charAt(j - 1) == 'T'))
                    misMatchPenality = misMatchCost[C][T];
                else if ((str1.charAt(i - 1) == 'G' || str2.charAt(j - 1) == 'G') && (str1.charAt(i - 1) == 'T' || str2.charAt(j - 1) == 'T'))
                    misMatchPenality = misMatchCost[G][T];
            }

            if (str1.charAt(i-1)==str2.charAt(j-1)){
                i--;
                j--;
                s1res[s1i--] = str1.charAt(i);
                s2res[s2i--] = str2.charAt(j);
            }
            else if (dp[i][j]==dp[i-1][j-1]+misMatchPenality){
                s1res[s1i--] = str1.charAt(i-1);
                s2res[s2i--] = str2.charAt(j-1);
                i--;
                j--;
            }

            else if(dp[i][j]==dp[i-1][j]+gapPenality){
                i--;
                s1res[s1i--]=str1.charAt(i);
                s2res[s2i--] = '_';
            }
            else if(dp[i][j]==dp[i][j-1]+gapPenality){
                j--;
                s2res[s2i--] = str2.charAt(j);
                s1res[s1i--] = '_';
            }

        }

        while(s1i>=0)
        {
            if(i>0)
                s1res[s1i--] = str1.charAt(--i);
            else
                s1res[s1i--] = '_';
        }
        while (s2i>=0)
        {
            if(j>0)
                s2res[s2i--]=str2.charAt(--j);
            else
                s2res[s2i--]='_';
        }

        //System.out.println(str1);
        //System.out.println(str2);
        //System.out.println(s1res);
        //System.out.println(s2res);
        System.out.println("Minimum Cost for Alignment : "+dp[l1][l2]);
        int si=0;
        for (i=len-1;i>=0;i--)
        {
            if(s1res[i]=='_' && s2res[i]=='_'){
                si=i+1;
                break;
            }
        }

        //StringBuilder sb1 = new StringBuilder();
        StringBuilder sb1 = new StringBuilder("_AC_ACTGAC__TACTGACTG_GTGACTACTG_AC_TGGCG");
        for(i=si;i<len;i++) {
            System.out.print(s1res[i]);
            //sb1.append(s1res[i]);
        }
        System.out.println();

        //StringBuilder sb2 = new StringBuilder();
        StringBuilder sb2 = new StringBuilder("TATTA_T_ACGCTATT_A_TACGCGAC_GC_GGACGCGGC_");
        for(i=si;i<len;i++) {
            System.out.print(s2res[i]);
            //sb2.append(s2res[i]);
        }
        System.out.println();
        System.out.println();
        System.out.println(sb1);
        System.out.println(sb2);
        int cost=0,cur=0;
        for(i=0;i<sb1.length();i++){
            if(sb1.charAt(i)=='_' || sb2.charAt(i)=='_')    cur=gapPenality;
            else if(sb1.charAt(i)==sb2.charAt(i))           cur=0;
            else {
                if ((sb1.charAt(i) == 'A' || sb2.charAt(i) == 'A') && (sb1.charAt(i) == 'C' || sb2.charAt(i) == 'C'))
                    cur = misMatchCost[A][C];
                else if ((sb1.charAt(i) == 'A' || sb2.charAt(i) == 'A') && (sb1.charAt(i) == 'G' || sb2.charAt(i) == 'G'))
                    cur = misMatchCost[A][G];
                else if ((sb1.charAt(i) == 'A' || sb2.charAt(i) == 'A') && (sb1.charAt(i) == 'T' || sb2.charAt(i) == 'T'))
                    cur = misMatchCost[A][T];
                else if ((sb1.charAt(i) == 'C' || sb2.charAt(i) == 'C') && (sb1.charAt(i) == 'G' || sb2.charAt(i) == 'G'))
                    cur = misMatchCost[C][G];
                else if ((sb1.charAt(i) == 'C' || sb2.charAt(i) == 'C') && (sb1.charAt(i) == 'T' || sb2.charAt(i) == 'T'))
                    cur = misMatchCost[C][T];
                else if ((sb1.charAt(i) == 'G' || sb2.charAt(i) == 'G') && (sb1.charAt(i) == 'T' || sb2.charAt(i) == 'T'))
                    cur = misMatchCost[G][T];
            }
            cost=cost+cur;


        }
        System.out.println();
        System.out.println("Traced Path Cost : "+cost);
    }
}
